var text = '';

var chars = text.split('');

var ascii = [];

for( var i = 0 ; i < chars.length ; i ++ ) {
	var c = chars[i];
	if( c ) {
		ascii.push( c.charCodeAt() );
	}
}

for( var i = 0 ; i < ascii.length - 1 ; ) {
	var sub = ascii[i] - ascii[i+1];
	if( Math.abs( sub ) == 32 ) {
		if( String.fromCharCode(ascii[i]).toUpperCase() == String.fromCharCode(ascii[i+1]).toUpperCase() ) {
		  ascii.splice( i, 2 );
		  i --;
		}
	} else {
	  i ++;
	}
}

console.info( ascii.length );
